//JEŚLI JUŻ BYŁY 3 PRÓBY WYSŁANIA WIADOMOŚCI
IF #Local.MessageSentCounter > 3 THEN
    IF NOT #Local.MessageSent THEN
        #Status.ErrorStatus  := #E_START_MACHINE_NOT_SENT;
    ELSIF #Local.MessageSent THEN
        #Status.ErrorStatus  := #E_START_MACHINE_NO_RESPONSE;
    END_IF;
    "changeState"(newState := #S_ERROR,
                  Data := #State);
    //WYSYŁANIE WIADOMOŚCI DO 3 RAZY    
ELSE
    #Local.MessageSentCounter := #Local.MessageSentCounter + 1;
    #Local.prevState := #State.state;
    "changeState"(newState := #S_REPEAT,
                  Data := #State);
END_IF;

